import { NavLink } from "react-router-dom";

import companyLogo from "../images/Logo-without-background.png";
import noAvatar from '/Users/luisjorge/code/Flatiron-Phase-2/16-Phase-2-Project/titan-capital-financial/src/images/no-avatar.png';

import "./NavBar.css";

import { Avatar } from "@mui/material";

function NavBar({ logout }) {
  return (
    <nav className="NavBar">
    <div class="navbar-1/4"></div>
      <img className="NavBar__logo" src={companyLogo} alt="Company logo" />
      <h1>Titan Financial</h1>
      <div class="NavBar__links">
        <NavLink to="/" className="nav-link">
          Home
        </NavLink>
        <NavLink to="/about" className="nav-link">
          About
        </NavLink>
      </div>
      {/* Add the logout function to handle the onClick event */}

      <button className="NavBar__Button" onClick={logout}>
        <Avatar src={noAvatar} alt="User Avatar" className="NavBar__Button__Avatar"/>
        Logout
      </button>
    </nav>
  );
}

export default NavBar;
